import React, { useEffect, useState } from "react";
import axios from "axios";

const DashboardTableData = () => {
  const [dashboardData, setDashboardData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
        try {
            const response = await axios.get("http://127.0.0.1:3000/dashboardData");
            const { data } = response; // Correctly set data to response.data
       
          setDashboardData(data); // Update state with the actual data
          
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <table border="1">
      <thead>
        <tr>
          <th>Name</th>
          <th>Product Name</th>
          <th>City</th>
          <th>Address</th>
          <th>Phone</th>
          <th>Quantity</th>
        </tr>
      </thead>
      <tbody>
        {dashboardData.map((data) => (
          <tr>
            <td>{data.name}</td>
            <td>{data.productName}</td>
            <td>{data.city}</td>
            <td>{data.address}</td>
            <td>{data.phone}</td>
            <td>{data.quantity}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default DashboardTableData;
